USE [master]
GO

CREATE DATABASE [miniatuurland]
GO

USE [miniatuurland]
GO

-- tabellen maken
CREATE TABLE [dbo].[Countries](
	[countryID] [int] IDENTITY(1,1) NOT NULL,
	[country] [nvarchar](50) NOT NULL,
 CONSTRAINT [PK_Countries] PRIMARY KEY CLUSTERED ([countryID]))
GO

CREATE TABLE [dbo].[Customers](
	[customerID] [int] IDENTITY(1,1) NOT NULL,
	[name] [nvarchar](50) NULL,
	[address] [nvarchar](50) NULL,
	[city] [nvarchar](50) NULL,
	[state] [nvarchar](15) NULL,
	[postalCode] [nvarchar](15) NULL,
	[countryID] [int] NULL,
	[username] [nvarchar](50) NOT NULL,
	[password] [nvarchar](128) NOT NULL,
	[applicationname] [nvarchar](255) NULL,
	[email] [nvarchar](128) NOT NULL,
	[passwordQuestion] [nvarchar](200) NULL,
	[passwordAnswer] [nvarchar](200) NULL,
	[comment] [nvarchar](255) NULL,
	[isapproved] [bit] NULL CONSTRAINT [DF_Customers_isapproved]  DEFAULT ((-1)),
	[lastactivitydate] [datetime] NULL,
	[lastlogindate] [datetime] NULL,
	[lastpasswordchangeddate] [datetime] NULL,
	[creationDate] [nvarchar](50) NULL,
	[IsOnline] [bit] NULL CONSTRAINT [DF_Customers_IsOnline]  DEFAULT ((0)),
	[IsLockedOut] [bit] NULL CONSTRAINT [DF_Customers_IsLockedOut]  DEFAULT ((0)),
	[FailedPasswordAttemptCount] [int] NULL CONSTRAINT [DF_Customers_FailedPasswordAttemptCount]  DEFAULT ((0)),
	[FailedPasswordAttemptWindowStart] [datetime] NULL,
	[FailedPasswordAnswerAttemptCount] [int] NULL CONSTRAINT [DF_Customers_FailedPasswordAnswerAttemptCount]  DEFAULT ((0)),
	[FailedPasswordAnswerAttemptWindowStart] [datetime] NULL,
 CONSTRAINT [PK_Customers] PRIMARY KEY CLUSTERED ([customerID]))
GO

ALTER TABLE [dbo].[Customers]  WITH CHECK ADD  CONSTRAINT [FK_Customers_Countries] FOREIGN KEY([countryID])
REFERENCES [dbo].[Countries] ([countryID])
GO

CREATE UNIQUE NONCLUSTERED INDEX [Uindex_Username] ON [dbo].[Customers] ([username])
GO

CREATE TABLE [dbo].[Employees](
	[employeeID] [int] IDENTITY(1,1) NOT NULL,
	[lastName] [nvarchar](50) NOT NULL,
	[firstName] [nvarchar](50) NOT NULL,
	[email] [nvarchar](100) NOT NULL,
	[reportsTo] [smallint] NULL,
	[jobTitle] [nvarchar](50) NULL,
	[userid] [nvarchar](50) NOT NULL,
	[password] [nvarchar](50) NOT NULL,
 CONSTRAINT [PK_Employees] PRIMARY KEY CLUSTERED ([employeeID]))
 GO

 CREATE TABLE [dbo].[Stores](
	[StoreId] [int] IDENTITY(1,1) NOT NULL,
	[StoreName] [nvarchar](50) NULL,
	[Address] [nvarchar](50) NULL,
	[Zip] [nvarchar](6) NULL,
	[City] [nvarchar](50) NULL,
	[latitude] [float] NULL,
	[longitude] [float] NULL,
 CONSTRAINT [PK_Stores] PRIMARY KEY CLUSTERED ([StoreId]))
GO

CREATE TABLE [dbo].[ProductLines](
	[productLineID] [int] IDENTITY(1,1) NOT NULL,
	[productLine] [nvarchar](50) NOT NULL,
	[description] [nvarchar](max) NULL,
 CONSTRAINT [PK_ProductLines] PRIMARY KEY CLUSTERED ([productLineID]))
GO

CREATE TABLE [dbo].[Products](
	[productID] [int] IDENTITY(1,1) NOT NULL,
	[product] [nvarchar](70) NULL,
	[scale] [nvarchar](10) NULL,
	[description] [nvarchar](max) NULL,
	[quantityInStock] [smallint] NULL,
	[quantityInOrder] [smallint] NULL,
	[buyPrice] [money] NULL,
	[productlineID] [int] NULL,
 CONSTRAINT [PK_Products] PRIMARY KEY CLUSTERED ([productID]))
GO

ALTER TABLE [dbo].[Products]  WITH CHECK ADD  CONSTRAINT [FK_Products_ProductLines] FOREIGN KEY([productlineID])
REFERENCES [dbo].[ProductLines] ([productLineID])
GO

CREATE TABLE [dbo].[Orders](
	[orderID] [int] IDENTITY(1,1) NOT NULL,
	[orderDate] [datetime] NULL,
	[requiredDate] [datetime] NULL,
	[shippedDate] [datetime] NULL,
	[status] [nvarchar](15) NULL,
	[comments] [nvarchar](max) NULL,
	[customerID] [int] NULL,
 CONSTRAINT [PK_Orders] PRIMARY KEY CLUSTERED ([orderID]))
GO

ALTER TABLE [dbo].[Orders]  WITH CHECK ADD  CONSTRAINT [FK_Orders_Customers] FOREIGN KEY([customerID])
REFERENCES [dbo].[Customers] ([customerID])
GO

CREATE TABLE [dbo].[OrderDetails](
	[orderID] [int] NOT NULL,
	[productID] [int] NOT NULL,
	[quantityOrdered] [smallint] NULL,
	[priceEach] [money] NULL,
 CONSTRAINT [PK_OrderDetails] PRIMARY KEY CLUSTERED ([orderID] ASC,	[productID] ASC))
GO

ALTER TABLE [dbo].[OrderDetails]  WITH CHECK ADD  CONSTRAINT [FK_OrderDetails_Orders] FOREIGN KEY([orderID])
REFERENCES [dbo].[Orders] ([orderID])
GO

ALTER TABLE [dbo].[OrderDetails]  WITH CHECK ADD  CONSTRAINT [FK_OrderDetails_Products] FOREIGN KEY([productID])
REFERENCES [dbo].[Products] ([productID])
GO

